import React from 'react'

const CardContainer = ({data}) => {

  return (
    <div className='card-container'>
        {
            data.map(player => 
                <PlayerCard key={player.name} name={player.name} img={player.img} statistic={player.statistics} />
                )
        }

    </div>
  )
}

export default CardContainer
